import React from "react";
import Layout from "../components/Layout";
import HomeBox from "../features/Home/HomeBox";
import LocalNav from "../features/Header/LocalNav";

function Home() {
	return (
		<Layout>
			<HomeComtainer>
				<LocalNav />
				<HomeBox></HomeBox>
			</HomeComtainer>
		</Layout>
	);
}

export default Home;

const HomeComtainer = styled.div``;
